import { useDispatch } from "react-redux";
import { dataActions } from "./store/data";
import Star from "./components/Layout/Buttons/Star";
import AddPopup from "./components/Layout/Add/AddPopup";
import ItemList from "./components/Layout/ItemList";
import { useEffect } from "react";
import { useSelector } from "react-redux";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faSpinner } from "@fortawesome/free-solid-svg-icons";

function DataFetcher() {
  const dispatch = useDispatch();

  useEffect(() => {
    fetch("https://dummyjson.com/products")
      .then((res) => res.json())
      .then((data) => dispatch(dataActions.dataInsert(data)))
      .then((data) => console.log(data));
  }, []);

  return null;
}

function App() {
  const storeDataLength = useSelector((state) => state.data.storeDataLength);

  return (
    <div>
      <DataFetcher />

      <AddPopup />

      <Star />

      <section className="list">
        <ItemList />
      </section>

      {storeDataLength === 0 && <FontAwesomeIcon icon={faSpinner} spin />}
    </div>
  );
}

export default App;
